import styled from 'styled-components';



const ControlWrapper = styled.div`

`;


const Label = styled.label`

`;


const Input = styled.input`

`;


const FormControl = () => {
    <ControlWrapper>
        <Label></Label>
        <Input type="text" name="fname" size="15"/>
    </ControlWrapper>
}
